import Quote from "./Quote";


const QuoteList = () => {
    return (
        <div>
        <Quote song="biisi 1" artist="esittäjä 1" year="2000" />
        <Quote song="biisi 2" artist="esittäjä 2" year="2001" />
        <Quote song="biisi 3" artist="esittäjä 3" year="2002" />
        </div>
    )
}

export default QuoteList;
